import React from 'react'
import { mount } from 'cypress-react-unit-test'
import { Button, Table } from 'antd'
import * as antd from 'antd'
import 'antd/dist/antd.css'

const dataSource = [
  {
    key: '1',
    name: 'Mike',
    age: 32,
    address: '10 Downing Street',
  },
  {
    key: '2',
    name: 'John',
    age: 42,
    address: '10 Downing Street',
  },
];

const columns = [
  {
    title: 'Name',
    dataIndex: 'name',
    key: 'name',
  },
  {
    title: 'Age',
    dataIndex: 'age',
    key: 'age',
  },
  {
    title: 'Address',
    dataIndex: 'address',
    key: 'address',
  },
];

describe("Button component", () => {
  it("Matches the snapshot", () => {
    mount(<><Table dataSource={dataSource} columns={columns} /><Table dataSource={dataSource} columns={columns} /><Table dataSource={dataSource} columns={columns} /></>);
  });
});
